const About = () => (
  <Layout>
    <article id="portfolio-container">
      <section>
        <img src="/photo.png" alt="myPhoto" />
      </section>
    </article>
    <style jsx>{`
      img {
        position:relative;
        width:30%;
        border-radius: 30%;
      }
    `}</style>
  </Layout>
);

export default About;
